css:
.linter-ui-plus .panel-row.panel-message > * {
  padding-top: 4px;
  padding-bottom: 4px;
}
.linter-ui-plus .panel-message .severity {
  padding-right: 5px;
}
.linter-ui-plus .panel-message .severity::before {
  position: relative;
  top: 1px;
  font-size: 16px;
}
.linter-ui-plus .panel-message .severity.luip-icon-error::before {
  color: #ff6347;
}
.linter-ui-plus .panel-message .severity.luip-icon-warning::before {
  color: #e2c08d;
}
.linter-ui-plus .panel-message .severity.luip-icon-info::before {
  color: #6494ed;
}
.linter-ui-plus .panel-message .position-row {
  color: rgba(157, 165, 180, 0.6);
  text-align: right;
  width: 1px;
  padding-left: 15px;
  min-width: 40px;
}
.linter-ui-plus .panel-message .position-separator {
  color: rgba(157, 165, 180, 0.6);
  text-align: center;
  width: 4px;
}
.linter-ui-plus .panel-message .position-column {
  color: rgba(157, 165, 180, 0.6);
  text-align: left;
  width: 1px;
  padding-right: 7px;
}
.linter-ui-plus .panel-message .provider-cell {
  white-space: nowrap;
  padding-left: 2px;
  padding-right: 6px;
}
.linter-ui-plus .panel-message .provider {
  color: rgba(157, 165, 180, 0.6);
  background: rgba(255, 255, 255, 0.05);
  border-radius: 3px;
  padding: 2px 4px;
  font-size: 12px;
}
.linter-ui-plus .panel-message .excerpt-cell {
  position: relative;
  width: 100%;
  padding-left: 3px;
  padding-right: 10px;
}
.linter-ui-plus .panel-message .excerpt-cell .icon {
  vertical-align: middle;
  margin-left: .7em;
  color: #6494ed;
}
